generateBinSizeStep.query:
q = load "${App.Datasets.PricingGuidanceDataset_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate case when ceil(count()/100) < 30 then 30 else ceil(count()/100) end as 'binsize';
q = limit q 1;

generateUniqueQuantityNumberStep.query:
q = load "${App.Datasets.PricingGuidanceDataset_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate unique('QuantitySum') as 'unique_QuantitySum';

generateAllRowsCountStep.query:
q = load "${App.Datasets.PricingGuidanceDataset_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate count() as 'count';
